import React, { Component } from 'react'
import logo from './Green_Logo'
import './home.css'

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: true, 
            autoplay: false,
        }
    }
    

render(){
    return(
        <div className='header'>
            <img id="Green_Logo" src={logo} />
        </div>
    )
}

}
